import classes from './DialogList.module.css'

const DialogList = (props) => {
    let dl = props.dialogs.map(d => <li></li>) 

    return (
        <div className={classes.dialog_list}>
            <ul>
                <li>Dialog1</li>
                <li>Dialog2</li>
            </ul>
        </div>
    )
}

export default DialogList;
